import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({ imageUrl }) => {
  return (
    <div className='center' style={{ position: 'relative', zIndex: 1 }}>
      <img id = 'inputimage' style={{ height: '350px', width: '650px' }} alt='FaceRecognition' src={imageUrl} />
    </div>
  );
};

// using position: 'relative' for just the sake of using zIndex no other use

export default FaceRecognition;
